import { Person } from '@material-ui/icons';
import React, {useState} from 'react'
import './Card.css'

function Card() {
    // eslint-disable-next-line
    const [people, setPeople] = useState([
        {
            name: "Elon Musk",
            url: "https://specials-images.forbesimg.com/imageserve/5de82785e961e100078f2c1b/960x0.jpg",
        },
        {
            name: "Jeff Bezos",
            url: "https://api.time.com/wp-content/uploads/2020/07/jeff-bezos.jpg",
        },
    ]);

    return (
        <div className="card">
            {people.map(person => (
                <h1>{person.name}</h1>
            ))}
        </div>
    );
}

export default Card
